import React from 'react';

const Home = () => {
    return (
        <div>
            <h1>Welcome to My Portfolio</h1>
            <p>This is the home section where you can find an overview of my work and artistic journey.</p>
            <p>Explore the sections above to learn more about me, my projects, and how to get in touch!</p>
        </div>
    );
};

export default Home;
